import React, {useState} from 'react';
import "../tabs/tab.css";
import Tab1Cont from './content-tabs/tab1Content';
import Tab2Cont from './content-tabs/tab2Cont';


const MainTabs = () => {
  const [toggleState, setToggleState] = useState(1);

  const toggleTab = (index) => {
    setToggleState(index);
    console.log(index)
  } 
    
// "tabs active-tabs"

  return (
    <div className='tabs__container'>

      <div className="block-tabs">
        <div className={toggleState === 1 ? "tabs active-tabs" : "tabs"} onClick={() => toggleTab(1)}>Арендатор</div>
        <div className={toggleState === 2 ? "tabs active-tabs" : "tabs"} onClick={() => toggleTab(2)}>Владелец</div>
      </div>

      <div className="content-tabs">
        <div className={toggleState === 1 ? "content active-contents" : "content"}><Tab1Cont/> </div>
        <div className={toggleState === 2 ? "content active-contents" : "content"}><Tab2Cont/> </div>
       </div> 

    </div>
  );
}

  


    

export default MainTabs;
